import React, { useEffect } from 'react';
import { Line } from 'react-chartjs-2';
import {
	Chart as ChartJS,
	CategoryScale,
	LinearScale,
	PointElement,
	LineElement,
	Title,
	Tooltip,
	Legend,
} from 'chart.js';
import './CurrentPrice.css';

ChartJS.register(
	CategoryScale,
	LinearScale,
	PointElement,
	LineElement,
	Title,
	Tooltip,
	Legend
);

const TodaysPrices = ({ TodaysPrices }) => {
	const labels = Array.from({ length: 24 }, (e, i) => i);
	console.log(labels);
	return (
		<div className='todaysPrices'>
			<h1>Todays Prices</h1>
			<Line
				data={{
					labels: labels,
					datasets: [
						{
							data: [12, 19, 3, 5, 2, 3],
						},
					],
				}}
				height={400}
				width={800}
				options={{ maintainAspectRatio: true }}
			/>
		</div>
	);
};

export default TodaysPrices;
